Let me think through this step by step...

**Key Psychological Mechanisms:**

The core psychological mechanisms at play in this responder's decision-making task involve fairness and self-interest.  Responders likely consider:

1. **Fairness:**  How equitable is the proposed split, considering both the relative contributions (tokens) of each party and the total earnings?  A perfectly fair split would divide the earnings proportionally to the tokens found.
2. **Self-interest:**  How much money will the responder receive if they accept the offer?  A higher monetary gain will generally be preferred.

**How these mechanisms interact:**

Fairness and self-interest are likely to be in tension. A perfectly fair offer might not maximize the responder's monetary gain, and an offer maximizing their gain might be perceived as unfair.  The responder's decision likely reflects a balance between these two drives, with individual differences influencing the weighting of each.

**Mathematical form:**

A simple model could represent the utility of accepting an offer as a linear combination of fairness and self-interest:

Utility =  weight_fairness * Fairness + weight_self_interest * Self_Interest

**Parameters needed:**

1. `weight_fairness`:  Represents the relative importance of fairness in the responder's decision-making.  A higher value indicates a greater concern for fairness.
2. `weight_self_interest`: Represents the relative importance of self-interest. A higher value indicates a greater concern for maximizing personal gain.

**Mapping variables to observable behavior:**

* **Fairness:**  This can be calculated as the difference between the proposed percentage split for the responder and a "fair" percentage, based on the ratio of tokens.  A higher value suggests the offer is considered more generous than fair.
* **Self-Interest:**  This is simply the amount of money the responder will receive (`split_self`).
* **Utility:** A higher utility value indicates a greater likelihood of accepting the offer. A threshold (e.g., 0) could be used to convert the utility into a binary acceptance/rejection decision.


