def simulate_model(trial_data, weight_fairness=1, weight_self_interest=1):
    utility_values = []
    for trial in trial_data:
        try:
            splitperc_self = trial['splitperc_self']
            token_self = trial['token_self']
            token_opp = trial['token_opp']
            split_self = trial['split_self']

            if token_self + token_opp ==0:
                fairness_term = 0 #avoid division by zero
            else:
                fairness_term = splitperc_self - (token_self / (token_self + token_opp)) * 100

            utility = weight_fairness * fairness_term + weight_self_interest * split_self
            utility_values.append(utility)
        except (KeyError, TypeError) as e:
            print(f"Error processing trial: {trial}.  Error: {e}")
            utility_values.append(float('nan')) # Handle missing data gracefully.

    return utility_values
